    data: |
      SELECT - COALESCE ( - - NULLIF ( + CAST ( - + 64 AS INTEGER ), + + 63 - + - 35 ), + + MAX ( + NULLIF ( + - 90, 63 ) ), 81 * + 86 ) AS col0;

outputs:
  - name: q5160.out
    data: |
      64
